import { Col, Row } from 'antd';
import styles from './style.module.css';

function Footer() {
  
  const bodyS = {
    background: 'url("/images/footer-bg.png")',
  };

  return (<>
    <div className={`container ${styles.body}`} style={bodyS}>
      <Row>
      <Col></Col>
      <Col></Col>
      </Row>
    </div>
  </>);
}
export default Footer;
